    // 判断是否有人
    function tagKeeper(movies,userDetail=false) {
        for (let i = 0; i < movies.length; i++) {
            let $movie = $(movies[i])
            let torrentDetailPath = $movie.find("a[href^='details.php']").attr("href")
            let seeders = $movie.find("a[href$='seeders']").text() || 0
            console.debug("做种人数" + seeders)
            let regex = /\d{3,6}/g
            let some_ids = torrentDetailPath.match(regex)
            if (!some_ids) {
                continue
            }
            // console.log(torrent_id[0])
            // 获取主标题 一般为英文
            let torrentName = $movie.find("a[href^='details.php']").attr("title")
            // 获取副标题
            let torrentSubName = $movie.find("td.embedded").text()
            let exist = existHash(some_ids[0],TORRENTID_HASHS)
            let td = document.createElement("td")
            // 是否是用户页面
            if (!userDetail){
                if (exist) {
                    // 获取选中的项
                    let $select = $("#selectRemoveOption")
                    let text = "有"
                    // 判断是否存在第二保种人
                    if (existHash(some_ids[0],SECOND_TORRENTID_HASHS)){
                        text = "有有"
                    }
                    //如果选项为不过滤
                    if ($select.val() === "0") {
                        td.innerHTML = "<b class='Keeper_Name'>"+text+"</b>";
                    }else if($select.val() === "1"){
                        $movie.remove();
                        continue
                    }else if ($select.val() === "2") {
                        if(text === "有"){
                            td.innerHTML = "<b class='Keeper_Name'>"+text+"</b>";
                        }else{
                            $movie.remove();
                            continue
                        }
                    }
                }else if (/第\d{1,3}集|第\d{1,3}-\d{1,3}集/.test(torrentSubName)) {
                    td.innerHTML = "<b>分集?</b>";
                }else if(torrentName.indexOf("720p")!==-1){
                    td.innerHTML = "<b>720</b>";
                }
            }else{
                torrentSubName = $movie.find("td.rowfollow").text()
                let officialTd = document.createElement("td")
                if(torrentName.toUpperCase().includes("HDS")){
                    officialTd.innerHTML = "可能";
                    // 判断分集
                    if ((/第\d{1,3}集|第\d{1,3}-\d{1,3}集/.test(torrentSubName))) {
                        officialTd.innerHTML = "<b>分集?</b>";
                    }
                } else {
                    officialTd.innerHTML = "";
                }
                $(officialTd).insertAfter(movies[i].lastElementChild);
                if (exist) {
                    td.innerHTML = "<b class='Keeper_Name'>有</b>";
                }
            }

            $(td).insertAfter(movies[i].lastElementChild);
        }
    }
    // 计算md5 并判断
    function existHash(torrentId,hashs) {
        var md5hash = torrentId
        for (let i = 0; i < 100; i++) {
            md5hash = CryptoJS.MD5(md5hash).toString()
        }
        console.debug(hashs.indexOf(md5hash) !== -1)
        return hashs.indexOf(md5hash) !== -1
    }
    function setLocalStorage(key,value){
        localStorage.setItem(key,value)
    }
    function getLocalStorage(key){
        return localStorage.getItem(key)
    }
    function isInLocalStorage(key){
        return !!localStorage.getItem(key)
    }
    // 计算总大小
    $("#calcKeepSize").click(function () {
        let $keeperTorrents = $("td.rowhead.nowrap:contains('认领的种子')");
        let $trs = $keeperTorrents.next().find("tr")
        let totalSize = 0.0
        let totalNumber = 0
        let torrentNameArr = []
        for (let i = 1; i < $trs.length; i++) {
            try {
                let torrentName = $trs[i].children[1].firstElementChild.title
                if (torrentNameArr.includes(torrentName)){
                    console.log("出现重复:" + torrentName)
                    continue
                }
                torrentNameArr.push(torrentName)
                totalNumber += 1
            } catch (e) {
            }
            let size = $trs[i].children[2].textContent
            if (size.endsWith("GB")) {
                console.debug("种子体积" + size)
                size = size.replace("GB", "")
                totalSize += parseFloat(size)
            }
        }
        totalSize = totalSize.toFixed(2)
        $keeperTorrents.find("#calcKeepSize").after("<br>" + totalNumber + "个"+"<br>" + totalSize + "GB")
    })
